import React, { useState } from "react";
import { data } from "../../helper/data";
import "./CardContainer.scss";

const CardContainer = () => {
  return (
    <div>
      <div>
        <input type="text" name="" id="" placeholder="Search Player..." />
      </div>
     <div>{data.map((player) => (
        <div className="card">
          <img src={player.img} alt="player-img" />
          <h3>{player.name}</h3>
          <div className="stats">
            {player.statistics.map((statistic) => (
              <li>{statistic}</li>
            ))}
          </div>
        </div>
      ))}
     </div>
    </div>
  );
};

export default CardContainer;
